                <Checkbox>Large Icon</Checkbox>
                <Checkbox>Image</Checkbox>
                <Checkbox>Notification Sound</Checkbox>
                <Checkbox>Coupons</Checkbox>
            </div>
        )
    }
}

export default AdvanceFeature
